    const {jwt} = useContext(AuthContext);

    const getData = async ()=>{
        try {
            const res = await axios.put('http://localhost:4000/account/update',{
                Headers: jwt,
            })
            
        } catch (e) {
            console.log(e)
        }
    }

  return (
    <>
        <div className='edit-profile'>
            <div>
                '
            </div>
                <img className='edit-img' alt='error'/>
            <div className='edit-form'>
                <label for='name'></label>
                <input name='name'/>
                <label for='pssword'></label>
                <input name='pssword'/>
            </div>
        </div>
    </>
  )
}

export default EditProfile
